INSERT INTO `bookclubs` VALUES
(1,'De Verhalenreis','Voor lezers die graag de wereld ontdekken via boeken, van fantasy tot non-fictie.','2024-12-06 14:49:55','2024-12-13 15:21:20'),
(2,'Het Literaire Kwartet','Een club voor diepe, kritische discussies over klassieke en moderne meesterwerken.','2024-12-13 15:21:33','2024-12-13 15:21:33'),
(3,'Bladzijde Voor Bladzijde','Een rustige boekenclub die het tempo laag houdt, ideaal voor drukke lezers.','2024-12-13 15:21:51','2024-12-13 15:21:51'),
(4,'Woorden & Wijn','Combineert een goed boek met een glas wijn en gezellige gesprekken.','2024-12-13 15:21:59','2024-12-13 15:21:59'),
(5,'Tussen De Regels','Voor lezers die graag de verborgen boodschappen en themas in boeken ontrafelen.','2024-12-13 15:22:06','2024-12-13 15:22:06'),
(6,'Het Boekengenootschap','Een gezellige club die alles leest, van bestsellers tot niche-literatuur.','2024-12-13 15:22:15','2024-12-13 15:22:15'),
(7,'Bibliomaniacs','Voor de echte boekenverslaafden die geen genre uit de weg gaan.','2024-12-13 15:22:25','2024-12-13 15:22:25'),
(8,'Koffie en Klassiekers','Perfect voor ochtenden met een kop koffie en tijdloze verhalen.','2024-12-13 15:22:32','2024-12-13 15:22:32'),
(9,'De Leesbrigade','Een club met een missie: zoveel mogelijk genres verkennen en bespreken.','2024-12-13 15:22:38','2024-12-13 15:22:38'),
(10,'Verhalenverzamelaars','Gericht op het ontdekken van nieuwe auteurs en onontdekte parels.','2024-12-13 15:22:46','2024-12-13 15:22:46'),
(11,'De Avondlezers','Een club die samenkomt in de avond om verhalen tot leven te laten komen.','2024-12-13 15:22:52','2024-12-13 15:22:52'),
(12,'Het Pagina-Avontuur','Voor avontuurlijke lezers die houden van verrassende twists en spannende plots.','2024-12-13 15:23:02','2024-12-13 15:23:02'),
(13,'Fictief & Feitelijk','Combineert fictie en non-fictie voor veelzijdige leeservaringen.','2024-12-13 15:23:08','2024-12-13 15:23:08'),
(14,'De Bladzijdes','Een luchtige boekenclub die draait om het delen van meningen en gezelligheid.','2024-12-13 15:23:15','2024-12-13 15:23:15'),
(15,'Letterliefhebbers','Voor mensen met een passie voor taal en literatuur.','2024-12-13 15:23:21','2024-12-13 15:23:21'),
(16,'De Leeskringen','Een traditionele boekenclub met ruimte voor iedereen die van lezen houdt.','2024-12-13 15:23:30','2024-12-13 15:23:30'),
(17,'De Boekhoeken','Voor lezers die van hoekige discussies en scherpe analyses houden.','2024-12-13 15:23:36','2024-12-13 15:23:36'),
(18,'Cover to Cover','Een internationale vibe, gericht op Engelstalige boeken en discussies.','2024-12-13 15:23:42','2024-12-13 15:23:42'),
(19,'Boek&Balans','Voor wie een boek wil combineren met mindfulness en persoonlijke groei.','2024-12-13 15:23:48','2024-12-13 15:23:48'),
(20,'Het Plotpunt','Ideaal voor fans van thrillers en verhalen met onverwachte wendingen.','2024-12-13 15:23:54','2024-12-13 15:23:54'),
